import { makeStyles } from '@material-ui/core/styles';

const MenuStyle = makeStyles(() => ({
    menu: {
        display: 'inline-block',
    },
    menuItem: {
        display: 'inline',
    },
    gray: {
        color: '#666666',
    },
}));

export default MenuStyle;
